import React, { useEffect, useState } from 'react';
import { CanvasJSChart } from 'canvasjs-react-charts';

const Line = ({ date, close }) => {
    return ( 
        <div>
            <CanvasJSChart id='line'
              options = { {
                animationEnabled: true,
                axisY: {
                  title: "USD",
                  prefix: "$"
                },
                data: [{
                  type: "line",
                  yValueFormatString: "$#,###.##",
                  dataPoints : {
                    x: new Date({date}),
                    y: Number({close})
                  }
                }],
              
              } }
            />
        </div> 
    );
};

export default Line;
